//for setting routes
//not a component
import React from 'react';
//import components
import LandingPage from './landingpage';
import {Switch, route} from 'react-router-dom';

const Main = () => {
	<Switch>
		<Router exact path="/" component = {LandingPage} />
	</Switch>
}

export default Main;
